export const TableB = (props) => {
    return <table className="tableB" {...props}></table>
    
}

export const TheadB = (props) => {
    return <thead className="theadB" {...props}></thead>
    
}

export const TrhB = (props) => {
    return <tr className="trh" {...props}></tr>
}

export const ThB = (props) => {
    return <th className="th" {...props}></th>

} 

export const TbodyB = (props) => {
    return <tbody className="tbodyB" {...props}></tbody>
}

export const TrbB = (props) => {
    return <tr className="trb" {...props}></tr>
}

export const Tdb = (props) => {
    return <td className="tdb" {...props}></td>
}
